import Link from 'next/link';


const linkStyle = {
  marginRight: 15
};

const Header = () => (
  <div>
    <header>
      <Link href="/">
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href="/list" as="list">
        <a style={linkStyle}>About</a>
      </Link>
    </header>
  </div>
);

export default Header;
